    false,nt"url": null,nt"notes": "This report provides detailed annotated
    accounts of 80 species of birds (including 24 confirmed or probable breeders and
    56 migrants or visitants) and 5 species of mammals observed at Alaid and Nizki islands
    between May and July of 1976. The status of breeding bird populations is documented
    to help assess the response of various species to the absence of arctic foxes. The
    red-faced cormorant was the most abundant of the breeding seabirds with an estimated
    population of 3,000 birds, while the lapland longspur was the most abundant of the
    breeding terrestrial birds with an estimated population of 1,100 birds. Dates of
    occurrence and numbers are summarized for all migrants and visitants.",nt"owner_org":
